// src/App.js
import React, { useState, useEffect } from 'react';
import { fetchWeatherData } from './services/weatherService';

const App = () => {
    const [countries, setCountries] = useState([]);  // Initialize as empty array
    const [cities, setCities] = useState([]);        // Initialize as empty array
    const [selectedCountry, setSelectedCountry] = useState('');
    const [selectedCity, setSelectedCity] = useState('');
    const [weatherData, setWeatherData] = useState(null);

    // Fetch country list from GeoNames API
    const fetchCountries = async () => {
        try {
            const response = await fetch(`http://api.geonames.org/countryInfoJSON?username=YOUR_GEONAMES_USERNAME`);
            const data = await response.json();
            setCountries(data.geonames);
        } catch (error) {
            console.error("Error fetching countries:", error);
        }
    };

    // Fetch cities based on selected country
    const fetchCities = async (countryCode) => {
        try {
            const response = await fetch(`http://api.geonames.org/searchJSON?formatted=true&country=${countryCode}&username=y0geshthakur&style=full`);
            const data = await response.json();
            setCities(data.geonames);
        } catch (error) {
            console.error("Error fetching cities:", error);
        }
    };

    // Handle country selection
    const handleCountryChange = (event) => {
        const countryCode = event.target.value;
        setSelectedCountry(countryCode);
        fetchCities(countryCode);
        setSelectedCity(''); // Reset city selection
    };

    // Fetch weather data on button click
    const handleGetWeather = async () => {
        if (selectedCity) {
            try {
                const data = await fetchWeatherData(selectedCity);
                setWeatherData(data);
            } catch (error) {
                console.error("Error fetching weather data:", error);
            }
        }
    };

    useEffect(() => {
        fetchCountries();
    }, []);

    return (
        <div className="App">
            <h1>Weather Monitoring System</h1>
            <div>
                <label htmlFor="country">Select Country:</label>
                <select id="country" onChange={handleCountryChange} value={selectedCountry}>
                    <option value="">Select a country</option>
                    {countries.length > 0 && countries.map(country => (
                        <option key={country.countryCode} value={country.countryCode}>
                            {country.countryName}
                        </option>
                    ))}
                </select>
            </div>
            <div>
                <label htmlFor="city">Select City:</label>
                <select id="city" onChange={(e) => setSelectedCity(e.target.value)} value={selectedCity} disabled={!selectedCountry}>
                    <option value="">Select a city</option>
                    {cities.length > 0 && cities.map(city => (
                        <option key={city.geonameId} value={city.name}>
                            {city.name}
                        </option>
                    ))}
                </select>
            </div>
            <button onClick={handleGetWeather}>Get Weather</button>
            {weatherData && (
                <div>
                    <h2>Current Weather in {selectedCity}</h2>
                    <p>Main Condition: {weatherData.weather[0].main}</p>
                    <p>Current Temperature: {weatherData.main.temp} °C</p>
                    <p>Feels Like: {weatherData.main.feels_like} °C</p>
                </div>
            )}
        </div>
    );
};

export default App;
